@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ATM a owl:Class .
:Account a owl:Class .
:Bank a owl:Class .
:CashCard a owl:Class .
:Customer a owl:Class .
:Withdrawal a owl:Class .

:ownsCard a owl:ObjectProperty ;
    rdfs:domain :Customer ;
    rdfs:range :CashCard .

:belongsToBank a owl:ObjectProperty ;
    rdfs:domain :ATM ;
    rdfs:range :Bank .

:hasAccount a owl:ObjectProperty ;
    rdfs:domain :Customer ;
    rdfs:range :Account .

:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain :CashCard ;
    rdfs:range :Bank .

:Withdrawal rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty :hasAccount ;
    owl:someValuesFrom [
        a owl:Restriction ;
        owl:onProperty :ownsCard ;
        owl:someValuesFrom :Customer
    ]
] .

:Withdrawal rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty :belongsToBank ;
    owl:someValuesFrom [
        a owl:Restriction ;
        owl:onProperty :cardIssuedBy ;
        owl:someValuesFrom :Bank
    ]
] .

:Withdrawal rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty :hasAccount ;
    owl:allValuesFrom [
        a owl:Restriction ;
        owl:onProperty :ownsCard ;
        owl:allValuesFrom :Customer
    ]
] .

:Withdrawal rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty :belongsToBank ;
    owl:allValuesFrom [
        a owl:Restriction ;
        owl:onProperty :cardIssuedBy ;
        owl:allValuesFrom :Bank
    ]
] .
